        <h1 className='header-title font-bold text-sm sm:text-xl flex flex-wrap'>
          <span className='text-slate-500'>Campus</span>
          <span className='text-slate-700'>Konect</span>
        </h1>
        <form action="">
          <input type="text" placeholder='search...' />
        </form>
      </div>
    </header>
    )
}

export default Header
